import './style.css'
import React, { useState } from 'react';


function Saldo() {
    const [isFocused, setIsFocused] = useState(false);

    const handleClick = () => {
      setIsFocused(false);
    };

    return (
      <div
        className={isFocused ? 'focused' : 'not-focused'}
        onClick={handleClick}
      >
        This div blurs on click
      </div>
        );

}

export default Saldo;
